September 5! Excited to be joining a panel highlighting nurses' influential role as healthcare advocates!

Session Title: Advocacy in Action: Empowering Nurses to Drive Positive Change in Healthcare

Discover the multifaceted responsibilities of nurses and their exceptional ability to champion the needs of patients and colleagues. Gain valuable insights into the various nursing roles and explore how their advocacy efforts empower patients and foster positive change in the healthcare landscape. 

So grateful to work with these wonderful women:
@thewritenurse 
@christyprn 
@shesinscrubs

This week has been a whirlwind. I still can't believe IMPACT had the opportunity to visit Washington, DC and advocate for workplace violence, prevention, and safe staffing. 

It was an incredible trip made possible by an amazing team at IMPACT who believed in our ability and made it all happen. 

IMPACT is operated by 100% volunteers. Our group of fierce bold advocates use their spare time to try to change our broken healthcare system. It makes me cry when I think about it.

Our group did everything from organizing meetings with lawmakers to providing educational support. This team in there day in and day out every step of the way, I couldn't have imagined a group like this. 

Thank you so much to every single IMPACT volunteer for making this trip so unforgettable and meaningful. I'm proud to have been a part of this organization and grateful to be surrounded by such dedicated and passionate individuals who are making a difference in the world. Here's to more many more trips in the future! 🙌❤️🏥

